package net.jeeshop.web.action.front.questionnaireResult;import net.jeeshop.core.Services;import net.jeeshop.services.front.questionnaireResult.QuestionnaireResultService;import net.jeeshop.services.front.questionnaireResult.bean.QuestionnaireResult;import net.jeeshop.web.action.front.FrontBaseController;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Controller;import org.springframework.web.bind.annotation.RequestMapping;/** * 问卷结果 * @author huangf * */@Controller("frontQuestionnaireResult")@RequestMapping("questionnaireResult")public class QuestionnaireResultAction extends FrontBaseController<QuestionnaireResult> {	private static final long serialVersionUID = 1L;	@Autowired	private QuestionnaireResultService questionnaireResultService;	public QuestionnaireResultService getQuestionnaireResultService() {		return questionnaireResultService;	}	public void setQuestionnaireResultService(			QuestionnaireResultService questionnaireResultService) {		this.questionnaireResultService = questionnaireResultService;	}	@Override	public Services<QuestionnaireResult> getService() {		return questionnaireResultService;	}}